Congrats to our winner: @jbbienz! 🎉 

It’s a Hanukkah Giveaway! Hanukkah is early this year (Dec. 7-15) and we wanted to bring you something special for your Hanukkah festivities or to give as a thoughtful gift to a friend who celebrates. We’ve teamed up to bring you a fun assortment of Hanukkah goodies, including @amandatoppeart’s new menorah tray outlined with hand-painted 22k gold (designed for @laurenhaskelldesigns Hanukkah ‘23 Collection) and a set of her dreidel coasters, a gold Star of David diamond bracelet by @miriammerenfeldjewelry, a beautiful set of Shabbat candlesticks from @myjewishmommylife, and a blue menorah glass drip tray/cutting board and a set of dreidel dish towels from @ariellezorgerdesigns. 

Entering is easy!
1. LIKE this post
2. FOLLOW: 
@amandatoppeart
@miriammerenfeldjewelry
@myjewishmommylife
@ariellezorgerdesigns
3. TAG two friends in the comments who you think would enjoy these items (the more tags, the more entries!)

The winner will be announced in our stories on Wednesday, November 1st. You have until noon on Wednesday to enter. Do not give your personal information to anyone. The winner will receive a direct message on Instagram from the verified @amandatoppeart account asking for a shipping address only. This giveaway is not associated with Instagram. 

